<script>
  document.documentElement.style.setProperty('--header-height', document.getElementById('shopify-section-header').offsetHeight + 'px');

  /*
  * Prevent the header to become transparent when the menu is open
  */

  document.addEventListener('scroll', () => {
    const headerElem = document.getElementById('section-header')

    if (!headerElem) {
      return
    }

    let isMenuOpen = false

    const horizontalListItems = document.getElementsByClassName('HorizontalList__Item')

    for (let item of horizontalListItems) {
      if (item.classList.contains('is-expanded')) {
        isMenuOpen = true
      }
    }

    if (isMenuOpen) {
      setTimeout(() => {
        headerElem.classList.remove('Header--transparent')
      }, 0)
    }
  })

  /*
  * Open the inner mega menu when hovering on the first level items
  */

  const firstLevelItems = document.getElementsByClassName('MegaMenu__FirstLevel__Item')

  const cleanMenuItem = (element) => {
    if (!element) {
      return
    }
    element.classList.remove('is-expanded')
    const elementId = element.id
    const menuTitle = elementId.split('_')[1]
    const targetElement = document.getElementById('mega-menu-inner_' + menuTitle)
    if (targetElement) {
      targetElement.classList.remove('is-expanded')
    }
  }

  const onSelectMenu = (event) => {
    let element = event.target
    while (element.tagName !== "LI") {
      element = element.parentNode
    }
    const elementId = element.id
    for (item of firstLevelItems) {
      if (item.id !== elementId) {
        cleanMenuItem(item)
      }
    }

    element.classList.add('is-expanded')
    const menuTitle = elementId.split('_')[1]
    const targetElement = document.getElementById('mega-menu-inner_' + menuTitle)
    if (targetElement) {
      targetElement.classList.add('is-expanded')
    }
  }

  for (let item of firstLevelItems) {
    item.addEventListener('click', onSelectMenu)
  }

</script>

