    <img src="//www.coque-en-bois.fr/cdn/shop/files/cookie_128x128.png?v=1687780227">
    <p>L'utilisation des cookies nous permet de vous offrir la meilleure expérience de navigation sur le site Coque en Bois. Acceptez-vous leur utilisation?</p>
  </div>
  <div class="button-wrapper">
    <button onclick="handleAccept()">J'accepte</button>
    <button onclick="handleDecline()">Je refuse</button>
  </div>
</section>

<script>
  function getBannerEl() {
    return document.getElementById('section-cookie-widget');
  }

  function showBanner() {
    getBannerEl().style.bottom = '20px';
  }

  function onSelectConsent() {
    getBannerEl().innerHTML = `<div><span class="title">C'est noté !</span><p>Bonne navigation sur notre site.</p></div>`;
    setTimeout(function () {
      getBannerEl().style.bottom = '-300px';
      setTimeout(function () {
        getBannerEl().style.display = 'none';
      }, 1000);
    }, 1000);
  }

  function handleAccept() {
    localStorage.setItem('cookieConsent', 'accepted');
    window.Shopify.customerPrivacy.setTrackingConsent(true, onSelectConsent);
  }

  function handleDecline() {
    localStorage.setItem('cookieConsent', 'rejected');
    window.Shopify.customerPrivacy.setTrackingConsent(false, onSelectConsent);
  }

  function initCookieBanner() {
    const userCanBeTracked = window.Shopify.customerPrivacy.userCanBeTracked();
    const userTrackingConsent = window.Shopify.customerPrivacy.getTrackingConsent();
    const cookieConsent = localStorage.getItem('cookieConsent');

    if (!cookieConsent || (!userCanBeTracked && userTrackingConsent === 'no_interaction')) {
      getBannerEl().style.display = 'flex';
      setTimeout(function () {
        showBanner();
      }, 1000);
    }
  }

  window.Shopify.loadFeatures(
    [
      {
        name: 'consent-tracking-api',
        version: '0.1',
      },
    ],
    function (error) {
      if (error) {
        throw error;
      }

      initCookieBanner();
    }
  );
</script>


